  const { id, title, content, status, creater } = list;
  return (
    <tr>
      <td>
        <input type="checkbox"></input>
      </td>
      <td>{title}</td>
      <td>{status}</td>
      <td>{creater}</td>
      <td>07-20-2020</td>
      <td></td>
    </tr>
  );
};

export default List;
